text:
@bunnyuihana あれも美味しいよね☺️‼︎
ルイボスのやつは
昨日ナリタヤでみたよ👏

@Aoi_oxo ルイボス茶かグァバ茶かな。たぶん
現地ではグァバを確かバンシローとかいう名前で呼んでるのでバンシロー茶っていわれて飲んでるかも

つか奄美の伝統飲料としちゃミキってのがあるんだけどそっちは体験済？

@juri0925 国産 どくだみ茶ティーパック 2g×100包×2袋 南九州産送料無料
https://t.co/9BaPxqYOgS
私はここで買ったけど、コメント見るとお店によって飲みにくいやつとかあるみたい🤔初めてルイボスティー飲んだ時、私も飲めなかったから、たぶん、ルイボスいけるならいける(どんだけルイボスに寄せるんw)

@ruibosu0222 おはようございます🌞

ルイボスさんのいつも頑張っている姿を知っているので、少しくらい弱音吐いても全然大丈夫ですよ✨

これからも応援しております!!

@tuna_tuna_tuna そうですねぇ、量に関しては意識しないとなかなか。
マスクで酸欠気味だなーと思ったら、換気扇の下で呼吸するついでに飲む、とかパターン化してますネ。

飲み物も一種類だけじゃなくて、白湯、ルイボス、ジャスミン、麦茶、緑茶（できれば緑茶を減らす）みたいに色々飲んでますネ。飽きない様に。

@Cognimoe_nigg ラムネ？？ラムネ？？？
私は、メロン烏龍茶を試すべきか迷い中w
ルイボスもいろいろあって、どれからチャレンジするかいつもまよーう。といいつつ、水出しの緑茶をゲットした。

@saya_gm_fgo 豚骨とかこってり系の所で多い気がするよね🥳

ラーメン屋さんでジャスミンとかルイボスのところもあるけど

そこら辺も嬉しい🥰

@kozuki_nao ほうほう！
私昨日、ルピシア行ってルイボスのピッコロ買ってきた✌️
まだ、飲めてないけど

@Saache_ff14 あれ？麦茶ってカフェインレスだっけ？
なら未接種状態継続や！

あとルイボスφ(..)

@gyunyupanlove ららさん、おはっぱー💚
冷やしたルイボスも最高ですよね☺️
お肌にも健康にもGOODです✨

@FunassyiMi なっしーさん、おはっぱー💚
おいしいですよね😊
ルイボス飲んで、いつまでも若々しくいましょう👍✨

@kagari_bi3 ほうじ茶はよく飲んでるー！
ほうじ茶ラテ美味しいよね😋

ルイボスは飲んだことないですね･･･試してみるかー

@Shimasan_Nu 完璧勘違いですwwww
申し訳ないw
あとルイボス茶置いてるの強い

@sou_to_yuzu あー🤦‍♀️😭ルイボスやったね💦
ボトルとチャームだけ回収して、紅茶パックは家族に飲んでもらうとか…🤔？
何なら、ルイボスだけ私が買い取るよ😊👍

@hiyokko_home ひよっこさん、こんぴよ💚
キンキンに冷えたルイボス、いいですね☺️
水分補給しっかりしていきましょう✨

@nanashi_neospi はっ！初リプなのにご挨拶もせず失礼いたしました💦😱よろしくお願いします❣️

ルイボスは飲みやすくて美味しいです💕
一度クセになるとばっかりになります☺️
